import React, { useRef, useEffect } from "react";
import SipClient from "./SipClient";

function Phone() {
    const audioRef = useRef(null);
    const sipClient = useRef(null);

    useEffect(() => {
        sipClient.current = new SipClient({ audioRef });
        sipClient.current.register();
    }, []);

    const handleMakeCall = (phone) => {
        sipClient.current.makeCall(phone);
    };

    return (
        <div>
            <audio ref={audioRef} autoPlay />
            <button onClick={() => handleMakeCall("0534217014")}>Make Call</button>
        </div>
    );
}

export default Phone;
